import React, { useState } from 'react';
import {MdExplore, MdTrackChanges, MdPersonPin} from 'react-icons/md';

function BottomNav() {
    const [selection, setSelection] = useState('feed');

    const handleChannels = () => {
        setSelection('channels');
    }
    const handleOptions = () => {
        setSelection('options');
    }

    if (selection === 'feed') {
    return(
        <div className='NavContainer' style={{display: 'flex', flexDirection: 'row', alignItems: 'center', justifyContent: 'center', backgroundColor: 'orange'}}>
            <div className='Channels' style={{display: 'flex'}}>
                <button style={{width: 150, height: 100, backgroundColor: '#fff', fontSize: 42}}><MdTrackChanges /></button>
            </div>
            <div className='Feed' style={{display: 'flex'}}>
                <button style={{width: 150, height: 100, backgroundColor: '#fff', fontSize: 42}}><MdExplore /></button>
            </div>
            <div className='Options' style={{display: 'flex'}}>
                <button style={{width: 150, height: 100, backgroundColor: '#fff', fontSize: 42}}><MdPersonPin /></button>
            </div>
        </div>
    )
    }
    else if (selection === 'channels') {
        return(
            <div>
                <h1>Channels</h1>
            </div>
        )
    }
    else if (selection === 'options') {
        return(
            <div>
                <h1>Options</h1>
            </div>
        )
    }
}

export default BottomNav;
